import React from 'react';
import Hero from '../components/Hero';
import Features from '../components/Features';
import Contact from '../components/Contact';
import Form from '../components/Form';

const Home = () => (
  <div>
    <Hero />
    <Features 
      title="Professional Experience"
      features={[
        {
          title: "Old Republic National Insurance Co - Automation Test Engineer",
          descriptions: [
            "Creating and maintaining automation test suites.",
            "Developing custom C# tools.",
            "Implementing DevOps strategies.",
            "Integrating Cucumber.",
            "Organizing defect meetings."
          ]
        },
        {
          title: "Old Republic National Insurance Co - Quality Assurance Test Analyst",
          descriptions: [
            "Manual testing of websites and applications.",
            "Overseeing testing efforts for events.",
            "Acting as SME and answering user questions.",
            "Training new team members."
          ]
        },
        {
          title: "Eagle Creek Software Services - Quality Assurance Analyst",
          descriptions: [
            "Testing ETL workflows.",
            "Authoring test plans and documentation.",
            "Documenting test procedures.",
            "Investigating customer problems.",
            "Collaborating with field staff."
          ]
        }
      ]}
    />
    <Features 
      title="Professional Skills"
      features={[
        {
          title: "Programming Languages",
          descriptions: [
            "C#, MSSQL, VB, JS, TS, Java, Python"
          ]
        },
        {
          title: "Testing Tools",
          descriptions: [
            "Selenium, Appium, Browserstack, ReadyAPI, Postman, ADO/GIT CI workflow"
          ]
        },
        {
          title: "Other Tools",
          descriptions: [
            "UIPath, TestConnect, Json, HTML, CSS, Jenkins, NUnit, Web Design, Restful Services, VMWare, Node.js"
          ]
        }
      ]}
    />
    <Contact />
    <Form />
  </div>
);

export default Home;
